import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';

function Login() {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const history = useHistory();

    const handleLogin = () => {
        if (email === 'yourEmail@example.com' && password === 'yourPassword') {
            // Successful login
            // You may also store the user's authentication token in local storage
            // to maintain their login status across page reloads
            localStorage.setItem('isLoggedIn', 'true');
            history.push('/app'); // Redirect to the main app page
        } else {
            // Display an error message or handle failed login attempts
            alert('Invalid email or password');
        }
    };

    return (
        <section className="text-center">
            <div
                className="p-5 bg-image"
                style={{
                    backgroundImage: "url('https://mdbootstrap.com/img/new/textures/full/171.jpg')",
                    height: '300px',
                }}
            ></div>
            <div
                className="card mx-4 mx-md-5 shadow-5-strong"
                style={{
                    marginTop: '-100px',
                    background: 'hsla(0, 0%, 100%, 0.8)',
                    backdropFilter: 'blur(30px)',
                }}
            >
                <div className="card-body py-5 px-md-5">
                    <div className="row d-flex justify-content-center">
                        <div className="col-lg-8">
                            <h2 className="fw-bold mb-5">Sign in</h2>
                            <form>
                                <div className="form-outline mb-4">
                                    <input
                                        type="email"
                                        id="email"
                                        className="form-control"
                                        value={email}
                                        onChange={(e) => setEmail(e.target.value)}
                                    />
                                    <label className="form-label" htmlFor="email">
                                        Email address
                                    </label>
                                </div>
                                <div className="form-outline mb-4">
                                    <input
                                        type="password"
                                        id="password"
                                        className="form-control"
                                        value={password}
                                        onChange={(e) => setPassword(e.target.value)}
                                    />
                                    <label className="form-label" htmlFor="password">
                                        Password
                                    </label>
                                </div>
                                <div className="form-check d-flex justify-content-center mb-4">
                                    <input
                                        className="form-check-input me-2"
                                        type="checkbox"
                                        value=""
                                        id="subscribe"
                                        checked
                                    />
                                    <label className="form-check-label" htmlFor="subscribe">
                                        Subscribe to our newsletter
                                    </label>
                                </div>
                                <button type="button" className="btn btn-primary btn-block mb-4" onClick={handleLogin}>
                                    Sign in
                                </button>
                                <div className="text-center">
                                    <p>or sign in with:</p>
                                    <button type="button" className="btn btn-link btn-floating mx-1">
                                        <i className="fab fa-facebook-f"></i>
                                    </button>
                                    <button type="button" className="btn btn-link btn-floating mx-1">
                                        <i className="fab fa-google"></i>
                                    </button>
                                    <button type="button" className="btn btn-link btn-floating mx-1">
                                        <i className="fab fa-twitter"></i>
                                    </button>
                                    <button type="button" className="btn btn-link btn-floating mx-1">
                                        <i className="fab fa-github"></i>
                                    </button>
                                </div>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        </section>
    );
}

export default Login;
